import React from 'react';
import { BrowseRouter as Router, Route, Routes } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import './styles.css';

function App(){
	return (
		<Router>
			<div className= "app">
				<Routes>
					<Route path="/" element={<Dashboard />} />
				</Routes>
			</div>
		</Router>
	);
}

export default App;
